import {
  Box,
  Grid,
  Typography,
  Select,
 MenuItem,
  InputBase,
  makeStyles,
  Button,
} from '@material-ui/core'
import React, { useState, useEffect } from 'react'
import 'antd/dist/reset.css'
import { Menu, Divider } from '@material-ui/core'
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown'
import SearchIcon from '@mui/icons-material/Search'
import CheckIcon from '@material-ui/icons/Check'

const useStyles = makeStyles((theme) => ({
  mainSection: {
    background: '#383858',
    marginTop: '4rem',
    paddingTop: '5rem',
    paddingBottom: '5rem',

    '& h3': {
      color: '#fff',
      paddingBottom: '1.8rem',
    },
  },
  gridSectio: {
    order: '1',
    '@media(max-width:952px)': {
      order: '3',
    },
  },
  gridSectio1: {
    color: '#000',
    order: '2',
    '@media(max-width:952px)': {
      order: '1',
    },
  },
  gridSectio2: {
    color: '#000',
    order: '3',
    '@media(max-width:952px)': {
      order: '2',
    },
  },
  gridSectio3: {
    color: '#000',
    order: '4',
    '@media(max-width:952px)': {
      order: '4',
    },
  },
  searchSection: {
    color: '#000',

    '@media(max-width:600px)': {
      marginTop: '.7rem',
    },
  },
  field: {
    height: '40px',
    border: '1px solid #bcbcbc',
    padding: '10px 10px 10px 0px',
    marginTop: '6px',
    fontSize: '14px',
    borderRadius: '5px',
  },
  dashboardSelectMenu: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'flex-start',
    marginTop:"35vh",
    marginLeft:"40rem"
    
    
    
  },
  btnSection: {
    width: '100%',
    display: 'flex',
    alignItems: 'center',
    marginTop: '19px',
    justifyContent: 'space-between',
    [theme.breakpoints.down('xs')]: {
      marginTop: '0px',
    },

    '& button': {
      height: '40px',
    },
  },
  date: {
    marginTop: '6px',
    color:"#000",
    '& .MuiOutlinedInput-root': {
      height: '40px',
    },
  },
}))
const skills = ['HTML', 'CSS', 'JavaScript', 'TypeScript', 'React']

export default function Filter() {
  const classes = useStyles()
  const [status, setStatus] = useState()
  const [location, setLocation] = useState()
  const [query, setQuery] = useState('')
  const [open, setOpen] = React.useState(false)
  const [value, setValue] = useState('')
  const [userList, setUserList] = useState([])
  

  const [anchorEl, setAnchorEl] = useState(null)
  const [searchText, setSearchText] = useState('')
  const [selection, setSelection] = useState('')
  const [rollid, setRollid] = useState('')
  const [user, setUser] = useState('')
  

  function setUserDetails(userlst) {
    console.log(userlst)
  }

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget)
  }

  const handelSetUse = (ulist, e) => {
    console.log(ulist)
    
  }

  const handleClose = (e) => {
    if (e.target.innerText !== selection && e.target.innerText !== '') {
      setSelection(e.target.innerText)
    }
    setSearchText('')
    setAnchorEl(null)
  }

  const handleSearchChange = (e) => {
    setSearchText(e.target.value)
  }

  const callUserApi = (e) => {
    console.log(localStorage.getItem('token'))
    setStatus(e.target.value)
    setRollid(e.target.value)
    setUser(e.target.value)
    console.log(localStorage.getItem('setStatus'))
    localStorage.setItem('rollId', e.target.value)
    localStorage.setItem('useridEarning', e.target.value)
    var myHeaders = new Headers()
    myHeaders.append('Authorization', 'Bearer ' + localStorage.getItem('token'))
    myHeaders.append('Content-Type', 'application/json')

    var raw = JSON.stringify({
      rollId: e.target.value,
    })

    var requestOptions = {
      method: 'POST',
      headers: myHeaders,
      body: raw,
      redirect: 'follow',
    }

    fetch(
      'https://uat.softmintdigital.com/reportservice/userReport/userreport',
      requestOptions,
    )
      .then((response) => response.json())
      .then((result) => {
        console.log(result)
        setUserList(result.userList)
        
      })
      .catch((error) => console.log('error', error))
  }

  return (
    <Box style={{ width: '100%' }}>
      <Grid container spacing={3}>
        <Grid item lg={6} md={6} sm={6} xs={12}>
          <Typography variant="body2">UserType</Typography>
          <Box
            className={classes.selectitem}
            style={{ marginTop: 'px', height: 'px' }}
          >
            <Select
              variant="outlined"
              fullWidth
              onChange={callUserApi}
              value={status}
            >
              <MenuItem value="" disabled={true}>
                Select Status
              </MenuItem>
              <MenuItem value={''}>All</MenuItem>
              <MenuItem value={3}>RESELLER</MenuItem>
              <MenuItem value={4}>SUPRT DISTRIBUTOR</MenuItem>
              <MenuItem value={5}>DISTRIBUTOR</MenuItem>
              <MenuItem value={6}>RETAILER</MenuItem>
              

            </Select>
          </Box>
        </Grid>
        <Grid item lg={6} md={6} sm={6} xs={12}>
          <div>
            <Button
             disabled={userList.length === 0}
              style={{
                backgroundColor: '#fff',
                width: '456px',
                marginTop: '19px',
                height: '43px',
                border: '1px solid #e3cfcf',
              }}
              type="button"
              className={classes.DropDownButton}
              onClick={handleMenuOpen}
            >
              {selection}
              <ArrowDropDownIcon
                style={{ position: 'absolute', right: '0px' }}
              />
            </Button>
            {renderDashboardMenu()}
          </div>
        </Grid>
      </Grid>
    </Box>
  )

  function renderDashboardMenu() {
    const displayOptions = userList
      .map((item) => {
        
        if (item.mobile.toLowerCase().includes(searchText.toLowerCase())) {
          return item
        }
        return undefined
      })
      .filter((item) => item !== undefined)

    function renderOption(value) {
      if (selection === value.mobile || selection === value.name) {
        return (
          <div className={classes.checkedItem}>
            <CheckIcon />
            {value.name + '(' + value.userName + ')'}
          </div>
        )
      }
      localStorage.setItem('useridEarning', value.userName)
      return value.name + '(' + value.userName + ')'
    }

    return (
      <div>
        <Menu
          anchorEl={anchorEl}
          keepMounted={true}
          open={!!anchorEl}
          onChange={handelSetUse}
          onClose={handleClose}
          className={classes.dashboardSelectMenu}
          anchorReference="anchorPosition"
          anchorPosition={{}}
          anchorOrigin={{
            vertical: 'bottom',
            horizontal: 'center',
          }}
          transformOrigin={{
            vertical: 'top',
            horizontal: 'center',
          }}
        >
          <MenuItem
            className={classes.searchBarContainer}
            disableTouchRipple={true}
          >
            <div className={classes.search}>
              <div className={classes.searchIcon}>
                <SearchIcon />
              </div>
              <InputBase
                placeholder="SEARCH..."
                classes={{
                  root: classes.inputRoot,
                  input: classes.inputInput,
                }}
                onChange={handleSearchChange}
              />
            </div>
          </MenuItem>
          <Divider />
          {displayOptions.map((userList, index) => {
            return (
              <div key={index}>
                <MenuItem onClick={handleClose}>
                  {renderOption(userList)}
                </MenuItem>
                <Divider className={classes.menuDivider} />
              </div>
            )
          })}
        </Menu>
      </div>
    )
  }
}
